Eam si varietatem diceres, intellegerem, ut etiam non dicente te intellego; Nunc de hominis summo bono quaeritur; Primum cur ista res digna odio est, nisi quod est turpis? Ergo id est convenienter naturae vivere, a natura discedere. Mihi, inquam, qui te id ipsum rogavi? Ego vero volo in virtute vim esse quam maximam;

Inde igitur, inquit, ordiendum est. Nummus in Croesi divitiis obscuratur, pars est tamen divitiarum. Audax negotium, dicerem impudens, nisi hoc institutum postea translatum ad philosophos nostros esset. Sed quid attinet de rebus tam apertis plura requirere? Vitae autem degendae ratio maxime quidem illis placuit quieta.

